import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import React,{useState} from 'react';
import axios from 'axios';
function AddVolunteering() {
    const [city,setCity]=useState({})
    const [nameVolunteering,setNameVolunteering]=useState({})
    const [volunteering,setVolunteering]=useState({})
    const addVolunteering =async()=>{
        const {data}= await axios.post("http://localhost:8000/volunteerType" ,nameVolunteering)
        const dataCity= await axios.post("http://localhost:8000/city" ,city)
        
        const dataVolunteering= await axios.post("http://localhost:8000/volunteering" ,volunteering)
       
    }
  return (
      <div >
    <Form>
        <Row className="mb-3">
        <Form.Group as={Col} controlId="formGridName">
          <Form.Label>סוג התנדבות</Form.Label>
          {/* לשאול האם כדאי לעשות select */}
          <Form.Control type="text" placeholder="Enter type volunteering" onChange={e=>setNameVolunteering({Name:e.target.value})}/>
        </Form.Group>
        <Form.Group as={Col} controlId="formGridName">
          <Form.Label>עיר</Form.Label>
          <Form.Control type="text" placeholder="Enter city" onChange={(e)=>setCity({Name:e.target.value})}/>
        </Form.Group>
        </Row>
      <Row className="mb-3">
        <Form.Group as={Col} controlId="formGridEmail">
          <Form.Label>זמן התחלה:</Form.Label>

          {/* <DateTimePicker onChange={onChange} value={value} />    */}
               </Form.Group>

        <Form.Group as={Col} controlId="formGridPassword">
          <Form.Label>זמן סיום:</Form.Label>
{/* <DateTimePicker onChange={onChange} value={value} /> */}
        </Form.Group>

    </Row>
   <Form.Group className="mb-3" controlId="formGridAddress1">
        <Form.Label>כתובת</Form.Label>
        <Form.Control placeholder="1234 Main St" type='text'onChange={(e)=>setVolunteering({...volunteering,Adress:e.target.value})}/>
      </Form.Group>

    

      <Row className="mb-3">
    

        <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
        <Form.Label>תאור</Form.Label>
        <Form.Control as="textarea" rows={3} type='text'onChange={e=>setVolunteering({...volunteering,Description:e.target.value})}/>
      </Form.Group>
      </Row>
    <Button variant="primary" type="submit" onClick={addVolunteering}>
       הוספת התנדבות
      </Button>
    </Form>
    </div>
  );
}

export default AddVolunteering;
